create table cities
(
    id           integer,
    name         varchar,
    state_id     integer,
    state_code   varchar,
    state_name   varchar,
    country_id   integer,
    country_code varchar,
    country_name varchar,
    latitude     numeric,
    longitude    numeric,
    "wikiDataId" varchar,
    PRIMARY KEY (id)
);

comment on table cities is 'Foi feito o import pelo Intellij';

alter table cities
    owner to silva;

